import React from "react";
import {Link} from 'react-router-dom';
import {FiPlus} from 'react-icons/fi';
import {Map, TileLayer} from 'react-leaflet';

import 'leaflet/dist/leaflet.css'

import mapMarkering from '../images/Logo_icon.svg';

import '../styles/pages/OrphanagesMap.css';

function OrphanagesMap(){
    return(
        <div id="page-map">
            <aside>
                <header>
                    <img src={mapMarkering} alt="Happy"/>
                    <h2>Escdolha um orfanato no mapa</h2>
                    <p>Muitas crianças estão esperando a sua visita</p>
                </header>

                <footer>
                    <strong>Luiz Antônio</strong>
                    <span>São Paulo</span>
                </footer>
            </aside>

            <Map center={[-21.5491957,-47.6947521]} zoom={15} style={{width:'100%', height: '100%'}}>
                {/* <TileLayer url="htpps://a.tile.openstreetmap.org/{z}{x}{y}.png"/> */}
                <TileLayer></TileLayer>
            </Map>

            <Link to ='' className="create-orphanage">
                <FiPlus size={32} color = '#fff'/>
            </Link>
        </div>
    );
}

export default OrphanagesMap;
